// --------------------------------------- Experience List
export const ExperienceList = [
    {
      img: "https://logowik.com/content/uploads/images/the-university-of-utah6232.logowik.com.webp",
      title: "Graduate Research Assistant",
      timeline: "May 2023 - Present",
      tech_stack: "AI, Deep Reinforcement Learning, Reinforcement Learning, Self Driving Cars",
      description: "Working in Artificial Intelligence domain by performing longitudinal study of how people iterate on reward design by using amazon deep racer car environment and also building AI tools that assist a user in reward design by applying ideas from Inverse Reward Design and active reward learning to cases where a human can write down reward functions",
      website: "https://www.utah.edu/",
    //   demo_url: "https://your_project_demo_link",
    },
    {
        img: "https://logowik.com/content/uploads/images/the-university-of-utah6232.logowik.com.webp",
        title: "Graduate Teaching Assistant",
        timeline: "Aug 2022 - Apr 2023",
        tech_stack: "Software Engineering, Computer Programming, Data Structures and Algorithms",
        description: "Assisting professors in teaching courses such as Software Engineering, Computer Programming, Data Structures and Algorithms by preparing course material and interacting with students in class, lab and online to answer their questions, grading assignments and exams.",
        website: "https://www.utah.edu/",
      //   demo_url: "https://your_project_demo_link",
      },
      {
        img: "https://upload.wikimedia.org/wikipedia/commons/b/b1/Tata_Consultancy_Services_Logo.svg",
        title: "Data Scientist",
        timeline: "Aug 2020 - July 2022",
        description: "Worked on end-to-end implementation of Customer lifetime value model, Media Mix Modelling and ROI analysis using Machine Learning and the goal is to develop econometric models to quantify marketing and pricing strategies for client Wiley, an American multinational publishing company.",
        tech_stack: "Machine Learning, MLflow, Statistics",
        website: "https://www.tcs.com/",
        // demo_url: "https://your_project_demo_link",
      },
      {
        img: "https://upload.wikimedia.org/wikipedia/commons/b/b1/Tata_Consultancy_Services_Logo.svg",
        title: "Software Engineer",
        timeline: "Jul 2019 - Jul 2020",
        description: "Worked end-to-end implementation of Data Warehouse Migration Project from source(Netezza) to target(Snowflake) for Client Western Union Financial Services Ltd, which include Business requirements gathering, Analysis, Design, Development, Testing, Code migration, Implementation, Support and Documentation.",
        tech_stack: "Snowflake, Tableau, SQL, Python",
        website: "https://www.tcs.com/",
        // demo_url: "https://your_project_demo_link",
      },
  ];
